INSERT INTO `disclaimer` VALUES (1, 'Resources and Training', '<p>Disclaimers  resources and training disclaimer</p><br>\r\n\r\n<p>Use of the materials found in the Resources and/or Training sections of the Global Pro System (GPS) Website is completely voluntary. GPS has provided these materials solely for GPS members'' convenience and use in operating his or her Vemma business. Use of these materials is not required to operate a Vemma business, and no GPS member is required or obligated to utilize these materials to remain a Vemma Brand Partner. Use of the materials in the Resources and/or Training sections does not guarantee any level of success in the operation of a Vemma business. The success or failure of each Brand Partner, like any other business endeavor, depends on each Brand Partners own skill, personal effort, as well as the amount of time dedicated to his or her business. Further, any level of success will depend on many factors such as how you use GPS and the GPS methods and procedures, your management skills and experience, your business judgment, economic conditions, the market, and the competition in the area in which you have chosen to do business. </p><br>\r\n\r\n<p>Actual business earnings will vary, and all individuals considering this business model should carefully consider the business model in its entirety, including the cost of engaging in this business. You acknowledge that no representations, guarantees or promises regarding income have been made to you.</p>\r\n<br>\r\n<p>You also acknowledge that Vemma is a company based on the quality of its health related products, and the use of these products by its customers. As such, GPS members are reminded that every Vemma Brand Partner should emphasize and focus his or her efforts on the sale of Vemma products for use by the purchaser. The GPS website and other GPS written materials, training, and all other tools available to GPS members are strictly for the purpose of selling Vemma products, building the member''s Vemma organization (which will increase the sale of Vemma products), and training and motivating his or her organization to sell Vemma products.</p><br>\r\n\r\n\r\n', '2012-01-25 00:00:00');
INSERT INTO `disclaimer` VALUES (2, 'US and Canadian Income Disclaimer', '<p>Disclaimers  US and Canadian Income Disclaimer</p><br>\r\n<p>\r\nThe testimonials or incomes presented are applicable only to the particular individuals depicted and are not representative of everyone''s income and are not a guarantee of your income, nor are they typical. Each individual''s success will be determined by his or her desire, dedication, effort, ability to follow directions and personal talent, as well as, the amount of time dedicated to his or her business. The Global Pro System has contributed to successful business development for some Brand Partners; however, Global Pro System (GPS) cannot guarantee that by using GPSs training and marketing system you will achieve success. Your success will depend on many factors such as: how you follow the GPS, methods and procedures which you use, your management skill and experience, your business judgment, economic conditions, the market, and competition in the area in which you have chosen to do business. Actual business earnings will vary, and all individuals considering the business model should carefully consider the business model in its entirety including the costs of engaging in this business.</p><br>\r\n', '2012-01-26 00:00:00');
INSERT INTO `disclaimer` VALUES (3, 'Voluntary use disclaimer agreement', '<p>Disclaimers  voluntary use disclaimer agreement</p><br>\r\n<p>\r\nGlobal Pro System (GPS) has provided this and all services and business tools on the GPS website solely for GPS members'' convenience and use in operating his or her Vemma business. Any use of these services or business tools by any GPS member is completely voluntary and such use is not required to successfully operate his or her Vemma Business as a GPS member. No GPS member is required or obligated in any manner to use any of these services or business tools to remain a GPS member or a Vemma distributor. No GPS member may utilize any business tool or service in any manner to circumvent any policy, procedure or rule of either GPS or Vemma. Any GPS member utilizing the services and business tools offered on the website acknowledges that the GPS member is responsible for ensuring that his or her use of the service or business tool is in compliance with applicable law and all of Vemmas and GPSs policies, procedures, and rules.</p>\r\n', '0000-00-00 00:00:00');
INSERT INTO `disclaimer` VALUES (7, 'Business Methods Disclosure Statement and Arbitration Agreement ', '<p><b>Business Methods Disclosure Statement and Arbitration Agreement -</b></p>\r\n<p>Distributor Agreement\r\n1. Dispute Resolution - Binding Arbitration\r\n</p><br>\r\n<p>(a) Vemma Is A Third Party Beneficiary Only. This Agreement is made \r\nand entered into between Seller and Distributor only. Notwithstanding the \r\nforegoing, Vemma is an intended third party beneficiary of this \r\nAgreement only for purposes of Vemma''s ability to elect the dispute \r\nresolution provisions contained herein, and to share in the benefit of \r\nthe private statute of limitations and choice of law provisions in \r\nParagraphs 4 and 5 below. The Parties acknowledge that nothing contained \r\nherein is intended to create any involvement by, or responsibility of, \r\nor liability for, Vemma with respect to any dealings between Seller \r\nand Distributor, and the Parties further acknowledge that nothing \r\ncontained herein shall be argued by either of them to constitute any \r\nwaiver by Vemma of any defense which Vemma may otherwise have \r\nconcerning whether it can properly be made a party to any dispute \r\nbetween the Parties.\r\n</p><br>\r\n<p>(b) Procedure For Mandatory Mediation And Arbitration. With respect \r\nto any dispute between the Parties which arises out of, or relates \r\nin any way, in whole or in part, to this Agreement, including without \r\nlimitation the creation, sale, purchase, content, functionality, value, \r\nuse or consequences of use of the Products, or to this Agreement, or \r\nthe breach thereof, including without limitation, any tort claim, \r\nincluding fraudulent inducement of this Agreement or the dispute \r\nresolution provisions contained herein ("Claim"), the Parties agree:\r\n</p><br>\r\n<p>(1) First, to try in good faith to settle the Claim by good faith \r\nnegotiations;\r\n</p><br>\r\n<p>(2) Then, if such negotiations are not promptly successful, to \r\ntry in good faith to settle the Claim by mediation administered \r\nin Los Angeles, California, by the American Arbitration \r\nAssociation (AAA);\r\n</p><br>\r\n<p>(3) Finally if such mediation does not result in a resolution \r\nof the Claim, then Distributor, Seller and/or Vemma may \r\ndemand, as the sole and exclusive means and forum to resolve \r\nthe Claim, binding arbitration by a single arbitrator, such \r\narbitration to be conducted in Los Angeles, California, and \r\nadministered under the Commercial Arbitration Rules of the AAA. \r\nThe Arbitrator may be the person who previously served as \r\nmediator, but only with the consent of all parties to the \r\narbitration.\r\n</p><br>\r\n<p>(c) WAIVER OF JURY TRIAL. THIS PARAGRAPH EVIDENCES AN ADDITIONAL \r\nAGREEMENT TO ARBITRATE DISPUTES. ANY DISPUTE BETWEEN THE PARTIES \r\nSHALL BE SUBJECT TO BINDING ARBITRATION. THIS MEANS, AMONG OTHER \r\nTHINGS, THAT ANY DISPUTE, INCLUDING, WITHOUT LIMITATION, IN CONTRACT \r\nOR TORT, BASED UPON, ARISING OUT OF OR RELATING TO THIS AGREEMENT \r\nOR TO THE RELATIONSHIP OF THE PARTIES, OR THE SALE OF THE PRODUCTS \r\nIS SUBJECT TO BINDING ARBITRATION. IN ADDITION, ALL QUESTIONS \r\nREGARDING THE ARBITRABILITY OF THE DISPUTE, INCLUDING WHETHER \r\nTHE PARTIES HAVE AGREED TO ARBITRATE THE DISPUTE, SHALL BE DECIDED \r\nBY SUCH ARBITRATION. THIS AGREEMENT TO ARBITRATE ALL DISPUTES \r\nBETWEEN THE PARTIES APPLIES EVEN IF SOME PERSON OR ENTITY CLAIMS \r\nTHAT THIS AGREEMENT IS VOID, VOIDABLE OR UNENFORCEABLE FOR ANY REASON. \r\nBY AGREEING TO ARBITRATE, ALL PARTIES ARE WAIVING THEIR RIGHT TO \r\nJURY TRIAL, THEIR RIGHT TO APPEAL AND THEIR RIGHT TO CONDUCT \r\nDISCOVERY (EXCEPT AS SPECIFICALLY SET FORTH HEREIN). THIS AGREEMENT \r\nTO ARBITRATE SHALL SURVIVE THE TERMINATION OF THIS AGREEMENT. AS \r\nPROVIDED UNDER CALIFORNIA CODE OF CIVIL PROCEDURE SECTION 1290.4, THE \r\nPARTIES FURTHER AGREE THAT NOTICE AND SERVICE OF ANY PETITION TO \r\nCONFIRM AN ARBITRATION AWARD ISSUED PURSUANT TO THIS CLAUSE SHALL \r\nBE SUFFICIENT IF SERVED BY REGULAR MAIL.\r\n</p><br>\r\n<p>(d) Application Of Federal Arbitration Act. The Parties acknowledge \r\nthat this Agreement evidences a transaction involving interstate \r\ncommerce, and that the Federal Arbitration Act (FAA) and, to the \r\nextent not inconsistent, the AAA''s Commercial Arbitration Rules as \r\nsuch Rules exist as of the time any Claim arises, shall govern the \r\ninterpretation, enforcement and proceedings pursuant to this Dispute \r\nResolution Paragraph, except as specifically set forth herein\r\n</p><br>\r\n<p>(e) General Rules For Arbitration. </p><br>\r\n<p>(1) Separate Claim Resolution. The Parties agree that no \r\narbitration or other proceeding conducted pursuant to this \r\nAgreement shall allow class claims, or consolidation or \r\njoinder of claims or parties. \r\n</p><br>\r\n<p>(2) Qualifications Of Arbitrator. The Arbitrator shall be \r\na practicing attorney or retired judge having at least 15 \r\nyears experience with commercial litigation matters.\r\n</p><br>\r\n<p>(3) Timing Of Award. The Arbitrator''s award shall be made \r\nwithin 6 months following the appointment of an Arbitrator \r\nand the Arbitrator shall agree to comply with this schedule \r\nbefore accepting appointment.\r\n</p><br>\r\n<p>(4) Reasoned Award. The Arbitrators shall issue a reasoned \r\nwritten award reached only by strictly applying the rules \r\nof law to the facts.\r\n</p><br>\r\n<p>(5) Limitation On Damages. The Arbitrator shall be limited \r\nto awarding actual monetary damages only (as defined below) \r\nand SHALL NOT have the power to award special, incidental, \r\nindirect, punitive or exemplary or consequential damages \r\nwhatsoever (including, but not limited to, damages for loss \r\nof money, lost profits, capital, or income, loss of \r\nconfidential or other information, business interruption, \r\npersonal injury, loss of privacy, and any other pecuniary \r\nor other loss whatsoever) arising out of or in any way \r\nrelated to the use of or inability to use the materials, \r\nsystems, or the support services, or the provision of or \r\nfailure to provide support services, or otherwise under or in \r\nconnection with any provision of this Agreement, even if \r\neither of the Parties has been advised of the possibility of \r\nsuch damages. A Party''s actual damages for purposes of this \r\nsubparagraph shall be limited to the invoice amount of any \r\nreceivable owed to Seller or to the amount actually paid by \r\nDistributor for the materials or Systems, subtracting all \r\nincome derived from the sale of Vemma products and the sale \r\nof Seller''s Business Systems. The foregoing limitations, \r\nexclusions and disclaimers shall apply to the maximum extent \r\npermitted by applicable law, even if any remedy fails its \r\nessential purpose.\r\n</p><br>\r\n<p>(6) Applicable Rules And Discovery. The arbitration of any \r\nClaim will be governed by the discovery and summary judgment \r\nprovisions in the Federal Rules of Civil Procedure (Rules 26 \r\nthrough 37 and 56) and the Federal Rules of Evidence shall be \r\napplicable to all presentations of evidence, provided however, \r\nthat discovery will be limited to exchange of documents and 3 \r\ndays of deposition only. Written interrogatories shall not \r\nbe permitted.\r\n</p><br>\r\n<p>(7) Expenses Of Arbitration. Each Party shall bear its own \r\ncosts and expenses, including legal fees and an equal share \r\nof the Arbitrator''s fees and the administrative costs of the \r\narbitration during the arbitration provided, however, that the \r\nArbitrator shall have the power to award to the prevailing \r\nparty in any arbitration, the Arbitrator''s and the AAA''s fees, \r\nbut the Arbitrator shall not have the power to award attorneys \r\nfees or expert fees to any Party. \r\n</p><br>\r\n<p>(8) Jurisdiction And Venue. The Parties consent and submit to \r\nthe exclusive personal jurisdiction and venue of the Superior \r\nCourt and the United States District Court, both located in the \r\nCounty of Los Angeles, State of California, to compel \r\narbitration of a Claim in accordance with this Agreement, \r\nor to enforce any arbitration award issued pursuant to this \r\nAgreement.\r\n</p><br>\r\n<p>(9) Confidentiality. All arbitration proceedings will be \r\nclosed to the public and confidential, and all records \r\nrelating thereto will be permanently sealed, except as \r\nnecessary to obtain court confirmation of the arbitration \r\naward or as necessary to give effect to res judicata and \r\ncollateral estoppel, in which case all filings with any \r\ncourt shall be sealed to the extent permissible by the \r\ncourt. Nothing herein is intended to, or shall, preclude \r\na Party from communicating with, or making disclosures \r\nto, its lawyers, tax advisors, auditors and insurers, as\r\nnecessary and appropriate or from making such other \r\ndisclosures as may be required by law.\r\n</p><br>\r\n<p>Right To Opt Out Of Arbitration. Seller believes that the \r\nmost efficient method of resolving Distributor disputes is \r\nthrough neutral binding arbitration. Distributor may, \r\nhowever, opt out of the obligation to arbitrate disputes \r\nby signing the form at the end of this agreement and \r\nmailing it to Seller within 30 days of execution \r\nof this Agreement.\r\n</p><br>\r\n<p>Alternative to Binding Arbitration of Disputes. The \r\nprovisions of this Paragraph shall apply to the resolution \r\nof any dispute between the Parties which is not subject \r\nto arbitration for any reason, including but not limited \r\nto: (a) Distributor''s election to opt out of arbitration \r\npursuant to Paragraph 1(e)(10) hereof; (b) determination \r\nby a court of competent jurisdiction that Paragraph 1(e)\r\n(1) entitled "Separate Claims Resolution" is invalid; \r\nor (c) determination for any reason that Paragraph 1(b) \r\nentitled "Procedure for Mandatory Mediation and \r\nArbitration" is invalid, in whole or in part. If for \r\nany reason, the Parties do not arbitrate a dispute \r\nand instead are permitted to bring an action in Superior \r\nCourt or in a U.S. District Court, the following \r\nprovisions shall apply:\r\n</p><br>\r\n<p>(f) WAIVER OF JURY TRIAL. To the extent permitted by law, \r\nin connection with any action or proceeding, whether \r\nbrought in state or federal court, the Parties hereby \r\nexpressly, intentionally and deliberately waive any right \r\nthey may otherwise have to trial by jury of any Claim\r\n</p><br>\r\n<p>\r\n(g) JUDICIAL REFERENCE. If the waiver of jury trial set \r\nforth hereinabove is not enforceable for any reason, \r\nthen the Parties hereby agree that all Claims, including \r\nany and all questions of law or fact relating thereto, \r\nshall, at the written request of any Party, be determined \r\nby Reference as set forth herein below:\r\n</p><br>\r\n<p>(1) Selection or Appointment of Referee. The Parties \r\nshall select a single neutral referee, who shall be a \r\nretired state or federal judge. In the event that \r\nthe Parties cannot agree upon a referee, the referee \r\nshall be appointed by the court.\r\n</p><br>\r\n<p>(2) Conduct of Reference. Except as otherwise provided \r\nin this Agreement, the Reference shall be conducted \r\npursuant to California Code of Civil Procedure Sections \r\n638 et seq. The referee shall determine all issues \r\nrelating to the applicability, interpretation, legality \r\nand enforceability of this Agreement. The referee shall \r\nreport a statement of decision to the court. The Parties \r\nshall equally bear the fees and expenses of the referee, \r\nunless the referee otherwise provides in the statement \r\nof decision.\r\n</p><br>\r\n<p>(3) Provisional Remedies and Self-Help. No provision \r\nof this Agreement shall limit the right of any party to \r\n(i) exercise self-help remedies including, without \r\nlimitation, set-off or (ii) to obtain or to oppose \r\nprovisional or ancillary remedies from a court of competent \r\njurisdiction before, after or during the pendency of the \r\nReference. The exercise of, or opposition to, any such \r\nremedy does not waive the right of any Party to a \r\nReference pursuant to this Agreement.\r\n</p><br>\r\n<p>(4) No Decision By Jury. The Parties hereby acknowledge \r\nthat if a referee is selected or appointed to determine \r\nthe Claims, then the Claims will not be decided by a jury.\r\n</p><br>\r\n<p>\r\n2. Advice Of Counsel. The Parties recognize and understand that \r\nthey are executing a legal agreement. Each Party represents that \r\nit has consulted legal and financial advisors, or that they have \r\nbeen given the opportunity to consult with such advisors prior to \r\nexecuting this Agreement. \r\n</p><br>\r\n<p>3. Severability. If any one or more of the provisions contained \r\nherein shall for any reason be found by a court of competent \r\njurisdiction or an arbitrator to be invalid, illegal, or \r\nunenforceable in any respect, such invalid, illegal or \r\nunenforceable provisions shall be ineffective, but shall not in \r\nany way invalidate or otherwise affect any other provision. \r\nNotwithstanding the foregoing, if Paragraph 16(e)(1) entitled \r\n"Separate Claim Resolution" is found for any reason to be \r\nunenforceable, either party shall have the right, but not the \r\nobligation, to require that a Claim be resolved exclusively in \r\na judicial proceeding in either the Superior Court of the United \r\nStates District Court, both located in the County of Los Angeles, \r\nCalifornia, rather than through arbitration.\r\n</p><br>\r\n<p>4. Limitations Of Actions. Notwithstanding any statute or other \r\nlegal or equitable doctrine or authority to the contrary, no \r\nClaim shall be brought more than eighteen (18) months after the \r\npurchase of the Products.\r\n</p><br>\r\n<p>5. Choice Of Law. This Agreement shall be governed by and \r\ninterpreted in accordance with the Federal Arbitration Act, \r\nand shall otherwise be governed by and interpreted in accordance \r\nwith the domestic law of the state of California. \r\n</p><br>\r\n\r\n', '0000-00-00 00:00:00');
